package testmessenger.ICQ;

import junit.framework.*;
import messenger.ICQ.ICQSRV_REPLYROSTERPacket;
import java.util.Vector;

/**
 * @author Bart Van Rompaey
 * @version $Revision: 1.1 $
 * @date $Date: 2003/04/04 18:02:13 $
 * 
 * 
 */
public class ICQSRV_REPLYROSTERPacketTest extends TestCase {

	/**
	 * Constructor for ICQSRV_REPLYROSTERPacketTest.
	 * @param arg0
	 */
	public ICQSRV_REPLYROSTERPacketTest(String arg0) {
		super(arg0);
	}

	/**
	 * @see TestCase#setUp()
	 */
	protected void setUp() throws Exception {
		super.setUp();
	}
	
	public static Test suite() {
		return new TestSuite(ICQSRV_REPLYROSTERPacketTest.class);
	}

	/**
	 * @see TestCase#tearDown()
	 */
	protected void tearDown() throws Exception {
		super.tearDown();
	}

	public void testICQSRV_REPLYROSTERPacket() {
		ICQSRV_REPLYROSTERPacket rr1 = new ICQSRV_REPLYROSTERPacket("");
		ICQSRV_REPLYROSTERPacket rr2 = new ICQSRV_REPLYROSTERPacket("");
		ICQSRV_REPLYROSTERPacket rr3 = new ICQSRV_REPLYROSTERPacket("");
		ICQSRV_REPLYROSTERPacket rr4 = new ICQSRV_REPLYROSTERPacket("");	
	}

	public void testGetKindOfPacket() {
		ICQSRV_REPLYROSTERPacket rr1 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr1.getKindOfPacket().equals("SRV_REPLYROSTER"));
		ICQSRV_REPLYROSTERPacket rr2 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr2.getKindOfPacket().equals("SRV_REPLYROSTER"));
		ICQSRV_REPLYROSTERPacket rr3 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr3.getKindOfPacket().equals("SRV_REPLYROSTER"));
		ICQSRV_REPLYROSTERPacket rr4 = new ICQSRV_REPLYROSTERPacket("");	
		assertTrue(rr4.getKindOfPacket().equals("SRV_REPLYROSTER"));
	}
	
	public void testGetList() {
		ICQSRV_REPLYROSTERPacket rr1 = new ICQSRV_REPLYROSTERPacket("");
		Vector v1 = rr1.getList();
		Vector ign1 = rr1.getIgnoreList();
		assertTrue(v1.size()+ign1.size() == 109);
		ICQSRV_REPLYROSTERPacket rr2 = new ICQSRV_REPLYROSTERPacket("");
		Vector v2 = rr2.getList();
		Vector ign2 = rr2.getIgnoreList();
		assertTrue(v2.size() +ign2.size() == 97);
		ICQSRV_REPLYROSTERPacket rr3 = new ICQSRV_REPLYROSTERPacket("");
		Vector v3 = rr3.getList(); 
		Vector ign3 = rr3.getIgnoreList();
		assertTrue(v3.size()+ign3.size() == 3);
		ICQSRV_REPLYROSTERPacket rr4 = new ICQSRV_REPLYROSTERPacket("");	
		Vector v4 = rr4.getList();
		Vector ign4 = rr4.getIgnoreList();
		assertTrue(v4.size()+ign4.size() == 42);
	}

	public void testGetContentHex() {
		ICQSRV_REPLYROSTERPacket rr1 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr1.getContentHex().equals(""));
		ICQSRV_REPLYROSTERPacket rr2 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr2.getContentHex().equals(""));

		ICQSRV_REPLYROSTERPacket rr3 = new ICQSRV_REPLYROSTERPacket("");
		assertTrue(rr3.getContentHex().equals(""));
		ICQSRV_REPLYROSTERPacket rr4 = new ICQSRV_REPLYROSTERPacket("");	
		assertTrue(rr4.getContentHex().equals(""));
	}

	public void testGetLength() {
		ICQSRV_REPLYROSTERPacket rr1 = new ICQSRV_REPLYROSTERPacket("");
		//System.out.println(rr1.getLength());
		assertTrue(rr1.getLength() == 2144);
		ICQSRV_REPLYROSTERPacket rr2 = new ICQSRV_REPLYROSTERPacket("");
		//System.out.println(rr2.getLength());
		assertTrue(rr2.getLength() == 2975);
		ICQSRV_REPLYROSTERPacket rr3 = new ICQSRV_REPLYROSTERPacket("");
		//System.out.println(rr3.getLength());
		assertTrue(rr3.getLength() == 188);
		ICQSRV_REPLYROSTERPacket rr4 = new ICQSRV_REPLYROSTERPacket("");	
		//System.out.println(rr4.getLength());
		assertTrue(rr4.getLength() == 1233);
	}
	
	public static void main (String[] args) {
		junit.textui.TestRunner.run(suite());
	}

}
